import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import InputLabel from '@material-ui/core/InputLabel';
import MenuItem from '@material-ui/core/MenuItem';
import ListSubheader from '@material-ui/core/ListSubheader';
import FormControl from '@material-ui/core/FormControl';
import Select from '@material-ui/core/Select';

const useStyles = makeStyles((theme) => ({
  formControl: {
    margin: theme.spacing(1),
    minWidth: 120,
  },
}));

export const FilterTime = () => {
  const classes = useStyles();
  return (
    <div>
      <FormControl className={classes.formControl}>
        <InputLabel htmlFor="grouped-native-select">Grouping</InputLabel>
        <Select native defaultValue="" id="grouped-native-select">
            <option value={1}>30 ngày trước</option>
            <option value={2}>tháng trước</option>
            <option value={2}>tháng này</option>
            <option value={2}>tùy chọn</option>
        </Select>
      </FormControl>
      {/* <FormControl className={classes.formControl}>
        <InputLabel htmlFor="grouped-select">Grouping</InputLabel>
        <Select defaultValue="" id="grouped-select">
          <MenuItem value={1}>Dịch Vụ Trả Phí Khác</MenuItem>
          <MenuItem value={2}>Cửa Hàng</MenuItem>
          <MenuItem value={2}>Quảng Cáo</MenuItem>
          <MenuItem value={2}>Gói Tin</MenuItem>
          <MenuItem value={2}>Gói Nạp Tiền</MenuItem>
          <MenuItem value={2}>Thành Viên</MenuItem>
        </Select>
      </FormControl> */}
      <FormControl className={classes.formControl}>
        <InputLabel htmlFor="grouped-native-select">Grouping</InputLabel>
        <Select  defaultValue="" id="grouped-select">
            <option value={1}>Dịch Vụ Trả Phí Khác</option>
            <option value={2}>Cửa Hàng</option>
            <option value={2}>Quảng Cáo</option>
            <option value={2}>Gói Tin</option>
        </Select>
      </FormControl>
    </div>
  );
}
